import React from 'react';
import image1 from './Images/image1.jpg';
import image2 from './Images/image2.jpg';
import image3 from './Images/image3.jpg';
import image4 from './Images/image4.jpg';

class LocalDetails extends React.Component {
    render() {
        // Array of image URLs for the gallery
        const images = [image1, image2, image3, image4];

        return (
            <div className="centered-carousel">
                <section>
                    <div>
                        <h2>Logement entier : h√©bergement - Larbaa Beni Hassen, Maroc</h2>
                    </div>
                    <div>
                        <ol>
                            <li>6 voyageurs</li>
                            <li>3 chambres</li>
                            <li>5 lits</li>
                            <li>2 salles de bain</li>
                        </ol>
                    </div>
                </section>
                
                <div id="carouselExampleInterval" className="carousel slide" data-bs-ride="carousel" style={{ width: '500px', height: '500px', margin: '0 auto' }}>
                    <div className="carousel-inner">
                        {images.map((image, index) => (
                            <div key={index} className={index === 0 ? "carousel-item active" : "carousel-item"} data-bs-interval="10000">
                                <img src={image} className="d-block w-100" alt="" style={{ width: '100%', height: '100%' }} />
                            </div>
                        ))}
                    </div>
                    <button className="carousel-control-prev" type="button" data-bs-target="#carouselExampleInterval" data-bs-slide="prev">
                        <span className="carousel-control-prev-icon" aria-hidden="true"></span>
                        <span className="visually-hidden">Previous</span>
                    </button>
                    <button className="carousel-control-next" type="button" data-bs-target="#carouselExampleInterval" data-bs-slide="next">
                        <span className="carousel-control-next-icon" aria-hidden="true"></span>
                        <span className="visually-hidden">Next</span>
                    </button>
                </div>
            </div>
        );
    }
}

export default LocalDetails;
